import React from 'react';
import { ContainerFooter, Rocket, Assinatura } from './styles';

export default function Footer() {
  return (
      <ContainerFooter>
        <Rocket>
          <img src='/assets/footer/rocket.svg' />
        </Rocket>

          <div>
          <Assinatura>
            <strong>Cuby Serviços Digitais</strong>&nbsp;© {new Date().getFullYear()} Todos os direitos reservados
            </Assinatura>
            <Logos>

            </Logos>
          </div>

      </ContainerFooter>
  )
}
